import React from 'react';
import './index.css';


function Home() {
      let curdate = new Date()
        const tt = new Date().toLocaleTimeString()
        curdate = curdate.getHours()
        let greeting = '';
        const css = { };

        if(curdate>1 &&  curdate<12){
        greeting = 'Good Morning';
        css.color = "green";
        }
        else if(curdate>=12 && curdate<16){
        greeting= 'Good Afternoon';
        css.color = "yellow";
        } 
        else if(curdate>=16 && curdate<20){
        greeting ='Good Evening';
        css.color = "orange";
        }
        else{
        greeting='Good Night';
        css.color = "black";
        }
        return(
            <div className='div'>
            <h1>Hello sir, <span style={css}>{greeting}</span><h1>Now the time is:{tt}</h1></h1>
            </div>
        )
}

export default Home;
